import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";

class Form extends Component {

    render() {
        return (
        <div>
            <form>
                <div className="form-row">
                    <div className="form-group col-md-4">

                    <input type="text" className="form-control" id="inputCity4" placeholder="City"/>
                    </div>
                    <div className="form-group col-md-4">

                    <input type="text" className="form-control" id="inputCountry4" placeholder="Country"/>
                    </div>
                </div>
                <button type="submit" className="btn btn-dark">GET WEATHER</button>
            </form>
        </div>
        );
    }
}

export default Form;
